import React from 'react'

function Mail() {

    function handleSubmit(e){

        e.preventDefault();
    }

  return (
    <div className='mail'>
      
      <form onSubmit={handleSubmit}>
        <input type='email' name='mail' placeholder='enter your email' /><br></br>
        <input type='text' name='subject' placeholder='enter your subject' /><br></br>
        <textarea rows={10} cols={30} placeholder='Write your message'/><br></br>
        <button type='submit'>Send</button>

      </form>
    </div>
  )
}

export default Mail
